        <StyleTodo>
            <AllTodo>
                <Form>
                    <Input></Input>
                    <Button>Enter</Button>
                </Form>
                <div>
                    <TodoItem />
                    <TodoItem />
                    <TodoItem />
                    <TodoItem />
                    <TodoItem />
                </div>
            </AllTodo>
        </StyleTodo>
    );
};

export default Todo;
